  <script>
    Condi = 'True'
    $(document).ready(function () {
      $('.alert').addClass("show");
      $('.alert').removeClass("hide");
      $('.alert').addClass("showAlert");
    });
    $('.close-btn').click(function () {
      $('.alert').removeClass("show");
      $('.alert').addClass("hide");
      $('.alert').bind('animationend webkitAnimationEnd oAnimationEnd MSAnimationEnd', function (e) { $('.alert-container').remove(); });

    });
  </script>

  <!--Alert Sys Animation Screen Width Responsive JS Script-->
  <script>
    if (screen.width > "467") {
      $(".alert").css({ "width": "100%" });
    }
    else if (screen.width < "290") {
      $(".alert").css({ "width": "55%" });
    }
    else if (screen.width < "300") {
      $(".alert").css({ "width": "63%" });
    }
    else if (screen.width < "380") {
      $(".alert").css({ "width": "77%", "right": "3%" });
    }
    // else if(screen.width < "415"){
    //   $(".alert").css({"width":"77%", "right":"3%"});
    // }
    else if (screen.width < "467") {
      $(".alert").css({ "width": "80%", "padding-right": "55px", "left": "1%" });
    }

  </script>
